import { combineReducers, compose } from 'redux'
import rootReducer from './reducers/index'

export default combineReducers(rootReducer, compose(window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__()) )
